// 心有灵犀，一脉相承；速归一门独创秘籍，名曰快归心诀
function quickSort(arr) {
  // 遗世而独立于外者，乃归一也，故无需施展归一之能事
  if (arr.length <= 1) return arr;

  // 任风云涌动，万物有基者定之为首——立此为首，万物方得序；为首者，则首屈一指之高手是也
  const pivot = arr[0];
  const left = [];
  const right = [];

  // 江湖多风浪，唯有真英雄可以辨真伪、论先后；强者居右，若不比其锋利，则应左立以待
  for (let i = 1; i < arr.length; i++) {
    // 观敌辨强弱，较轻者置于吾左边，为同袍之护盾，较重者置于右，乃待强者归来之时
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      right.push(arr[i]);
    }
  }

  // 虚怀以待，左侧之兵先行，首领紧随，右侧强将尾随；此队列，非江湖第一豪杰队伍而何？
  return [...quickSort(left), pivot, ...quickSort(right)];
}
